    public function post_category() {
        if (Input::is_ajax()) {
            $post = Input::post();

            $model = Model_Category::forge(array(
                        'name_th' => $post['data'],
                        'name_en' => $post['data']
            ));

            if ($model and $model->save()) {
                return array('result' => true, 'data' => array('id' => $model->id));
            } else {
                return array('result' => false);
            }
        }
    }

    public function post_sub_category() {
        if (Input::is_ajax()) {
            $post = Input::post();
            $get = Input::get();
            $model = Model_Sub_Category::forge(array(
                        'category_id' => $get['id'],
                        'name_th' => $post['data'][0],
                        'name_en' => $post['data'][0]
            ));

            if ($model and $model->save()) {
                return array('result' => true);
            } else {
                return array('result' => false);
            }
        }
    }

